<form method="post" class="container">
  <div id="content" class="row justify-content-center">
    <h1 class="col-md-12 col-sm-12 col-xs-12 text-center my-3">
      List Enseignant
    </h1>
    <div class="col-md-5 col-sm-12 col-xs-12">
      <label class="fw-bold">Matricule:</label>
      <div class="input-group mb-3">
        <span class="input-group-text" id="basic-addon1">
          <i class="fa fa-id-card icon"></i>
        </span>
        <input
          (keyup)="UpdateFilters($event)"
          type="text"
          class="form-control"
          placeholder="Matricule"
        />
      </div>
    </div>
    <div class="col-md-5 col-sm-12 col-xs-12">
      <label class="fw-bold">Nom:</label>
      <div>
        <div class="input-group mb-3">
          <span class="input-group-text" id="basic-addon1">
            <i class="fa fa-user icon"></i
          ></span>
          <input
            (keyup)="UpdateFilters($event)"
            type="text"
            class="form-control"
            placeholder="Nom"
          />
        </div>
      </div>
    </div>
    <div class="col-md-5 col-sm-12 col-xs-12">
      <label class="fw-bold">N° Tel:</label>
      <div>
        <div class="input-group mb-3">
          <span class="input-group-text" id="basic-addon1">
            <i class="fa fa-phone icon"></i
          ></span>
          <input
            (keyup)="UpdateFilters($event)"
            type="text"
            class="form-control"
            placeholder="N° Tel"
          />
        </div>
      </div>
    </div>
    <div class="col-md-5 col-sm-5 col-xs-12">
      <label class="fw-bold">Email:</label>
      <div>
        <div class="input-group mb-3">
          <span class="input-group-text" id="basic-addon1">
            <i class="fa fa-envelope icon"></i
          ></span>
          <input
            (keyup)="UpdateFilters($event)"
            type="email"
            class="form-control"
            placeholder="Email"
          />
        </div>
      </div>
    </div>
    <div class="col-md-4 col-sm-12 col-xs-12 text-center mb-3">
      <div id="search" (click)="Filter()" class="btn btn-primary">
        Rechercher
      </div>
    </div>
    <div id="tabl" class="col-md-10 col-sm-12 col-xs-12">
      <table class="table table-striped table-hover">
        <thead class="bg-primary">
          <tr>
            <th>Photo</th>
            <th>Nom</th>
            <th>Prenom</th>
            <th>Matricule</th>
            <th>Email</th>
            <th>Tel</th>
            <th>Fiche</th>
            <th>Supprimer</th>
          </tr>
        </thead>
        <tbody>
